import React from 'react';
import Product from './pages/Product';
import {
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
    <div className="app">
      <Product name="Njoki Studs" description="Yes. These are Njoki studs." />
    </div>
    </Router>
  );
}

export default App;
